script: |
  super -f text -I q10082.spq | sort > q10082.out

inputs:
  - name: q10082.spq
    data: |
      SELECT DISTINCT + + col1 AS col1 FROM tab1 (FORMAT parquet) WHERE 75 NOT BETWEEN + 8 AND NULL OR col0 * col2 + + - col1 * + + 59 IS NOT NULL;
  - name: tab1

outputs:
  - name: q10082.out
    data: |
      14
      47
      5
